import React from 'react';
import { Link } from 'react-router-dom';

function HeaderLinks({ setHoverItem }) {
  // Define links as an array of objects with name and path properties
  const links = [
    { name: 'Home', path: '/' },
    { name: 'Products', path: '/products' },
    { name: 'About', path: '/about' },
    { name: 'Contact', path: '/contact' }
  ];

  return (
    <div className="navbar-nav">
      {links.map(({ name, path }) => ( // Destructure name and path in the map callback
        <div
          key={name}
          onMouseEnter={() => setHoverItem(name)}
          onMouseLeave={() => setHoverItem(null)}
          className="nav-item"
        >
          <Link to={path} className="nav-link">{name}</Link> {/* Use the path for the Link's to attribute */}
        </div>
      ))}
    </div>
  );
}

export default HeaderLinks;
